import React from "react";

function Auth() {
  return (
    <div className="flex flex-col w-[40%] ml-10">
      <h1>please login</h1>
      <input className="bg-green-200 outline" type="text" />
      <input className="bg-green-200 outline border-slate-900" type="password" />
      <button className="bg-red-400 mt-10">login</button>
      <button>SignUp</button>
    </div>
  );
}

export default Auth;
